---
# Source: geth/templates/hooks.yaml
apiVersion: batch/v1
kind: Job
metadata:
  name: pre-load-genesis
  annotations:
    "helm.sh/hook": "post-install"
  labels:
    app: pre-load-genesis
spec:
  backoffLimit: 5
  template:
    spec:
      containers:
        - name: prepare-genesis
          image: busybox
          command:
            - sh
            - -c
            - |
            - |
              echo "Preparing chart files"
              mkdir -p /chart-files &&
              echo -n "" > /chart-files/genesis.ssz &&
              echo "File copied successfully to /chart-files"
          volumeMounts:
            - name: chart-files
              mountPath: /chart-files
      restartPolicy: OnFailure
      volumes:
        - name: chart-files
          persistentVolumeClaim:
            claimName: genesis-ssz-pvc
